INSERT INTO `admin_config_item` VALUES ('5', '网站描述', 'WEB_SITE_DESCRIPTION', '山东容诺光电科技有限公司位于山东省潍坊市高新区。公司成立于2012年,是一家国内领先的智能设备设计、研发、生产、销售易为一体的高新技术企业。拥有了一大批研发和管理精英，具备高水平的造型、结构、硬件、软件测试等研发能力。公司拥有专业的生产、研发体系管理团队。在不断追求产品创新的同时，公司更加注重产品质量和可靠性。为确保产品品质，公司对产品有一套严格的检测标准，实现全过程监督、检测，这为公司产品质量的稳定奠定了坚实的基础。 \r\n未来公司将继续秉持“立足潍坊、放眼全球”的战略布局，坚持“顺势而为、跨界共赢”的发展理念，专注服务智能设备及智能系统研发，创造卓越业绩。', 'system', 'textarea', '', '网站搜索引擎描述', '1378898976', '1379235841', '5', '1');
